comment: |
  Jefferson Lab - CEBAF. Measurement of the absolute cross sections and combinations of longitudinal and transverse structure functions in the electroproduction reaction E- P --& gt; E- PI+ N in the first and second nucleon resonance regions. The experiment uses an incident electron beam of energy 1.5 GeV and covers theQ**2 range 0.25 to 0.65 GeV**2.. This part (1) contains the structure function data for Q**2 = 0.30 and 0.40 GeV**2.
  Jefferson Lab - CEBAF. Measurement of the absolute cross sections and combinations of longitudinal and transverse structure functions in the electroproduction reaction E- P --& gt; E- PI+ N in the first and second nucleon resonance regions. The experiment uses an incident electron beam of energy 1.5 GeV and covers theQ**2 range 0.25 to 0.65 GeV**2.. This part (2) contains the structure function data for Q**2 = 0.50 and 0.60 GeV**2.
  Jefferson Lab - CEBAF. Measurement of the absolute cross sections and combinations of longitudinal and transverse structure functions in the electroproduction reaction E- P --& gt; E- PI+ N in the first and second nucleon resonance regions. The experiment uses an incident electron beam of energy 1.5 GeV and covers theQ**2 range 0.25 to 0.65 GeV**2.. This part (3) covers the absolute cross sections in the W region 1.110 to 1.150 GeV.. Numerical values supplied by H Egiyan.
  Jefferson Lab - CEBAF. Measurement of the absolute cross sections and combinations of longitudinal and transverse structure functions in the electroproduction reaction E- P --& gt; E- PI+ N in the first and second nucleon resonance regions. The experiment uses an incident electron beam of energy 1.5 GeV and covers theQ**2 range 0.25 to 0.65 GeV**2.. This part (4) covers the absolute cross sections in the W region 1.170 to 1.210 GeV.. Numerical values supplied by H Egiyan.
